    const errList = validationResult(req);
    if(errList.isEmpty()){
        res.render('index',({
            navBarDir : 'components/nav-bar/nav-bar',
            mainDir : 'components/main/home'
        }))
    }
}

export const userController = {
    getHomeUI,
    getEjercicio1UI
}
